import { Box, makeStyles, Grid, List, ListItem, ListItemText, ListSubheader, Hidden, Divider,fade } from "@material-ui/core";
import React from "react";
import Image6 from "../icons/image6";

const useStyles = makeStyles(() => ({
  footer: {
    backgroundColor: "#0C0C0C",
    color: "white",
    "& .MuiListSubheader-root": {
      color: "#fff",
    },
    "& .MuiDivider-root":{  
      backgroundColor: fade("#fff", 0.2),
    },
  },
  image: {
    height: "150px",
    width: "auto"
  }
}));

const Footer: React.FunctionComponent = () => {
  const classes = useStyles();

  return (
    <Box className={classes.footer} px={10} py={6}> 
        <Grid container justify="space-between">
    <Grid item xs={12} md={8} >
    <Grid container spacing={4}>
    <Grid item sm={4}>
      <List subheader={<ListSubheader>Popstack</ListSubheader>}>
      <Divider />
      <ListItem>
        <ListItemText primary="Wi-Fi" />
      </ListItem>
      <ListItem>
        <ListItemText primary="Bluetooth" />
      </ListItem>
    </List>
    </Grid>
    <Grid item  sm={4}>
      <List subheader={<ListSubheader>Support</ListSubheader>}>
      <Divider />
      <ListItem>
        <ListItemText primary="Wi-Fi" />
      </ListItem>
      <ListItem>
        <ListItemText primary="Bluetooth" />
      </ListItem>
    </List>
    </Grid>
    <Grid item sm={4}>
      <List subheader={<ListSubheader>Follow us</ListSubheader>}>
      <Divider />
      <ListItem>
        <ListItemText primary="Wi-Fi" />
      </ListItem>
      <ListItem>
        <ListItemText primary="Bluetooth" />
      </ListItem>
    </List>
    </Grid> 
    </Grid>
    </Grid>
    <Grid item  >
    <Hidden smDown><Grid item sm={2} >
    <Image6 className={classes.image}/>

    </Grid>
    </Hidden>
    </Grid>
    </Grid>
    </Box>
  );
};

export default Footer;
